Giải pháp đơn giản nhất là hình học. Hãy nhớ lại rằng $|z|$ có thể được hiểu là khoảng cách của $z$ tính từ gốc tọa độ trong mặt phẳng phức; thông tin đã cho cho chúng ta biết rằng $z$ nằm trên một đường tròn có bán kính 5 và $w$ nằm trên một đường tròn có bán kính 2. Vẽ các đường tròn này trong mặt phẳng phức, chúng ta thấy rằng $z$ và $w$ là gần nhau nhất khi chúng nằm trên một bán kính chung, với $w$ trong cùng góc phần tư với $z$. Điều này mang lại giá trị tối thiểu của $|z-w|$ là $5 - 2 = \boxed{3}$. (Đây là trường hợp đặc biệt của bất đẳng thức tam giác đối với số phức.)

[asy]
đơn vị(0,5 cm);

cặp Z, W;

Z = 2*dir(34);
W = 5*dir(78);

draw(Circle((0,0),2),red);
draw(Circle((0,0),5),blue);
hòa(Z--W);

dấu chấm("$z$", Z, SW);
dấu chấm("$w$", W, N);
[/asy]

