Tam giác $POD$ là tam giác có kích thước 45-45-90, vì vậy $DO = DP = \frac{\sqrt{2}}{2}$. Do đó, tọa độ của $P$ là $\left(-\frac{\sqrt{2}}{2}, \frac{\sqrt{2}}{2}\right)$, vì vậy \[\tan 135 ^\circ = \frac{\sin 135^\circ}{\cos 135^\circ} = \frac{\sqrt{2}/2}{-\sqrt{2}/2} = \boxed{-1 }.\]

