Vì đây là tam giác vuông nên $\sin L = \frac{MN}{LN}.$

Sử dụng Định lý Pythagore, chúng ta thấy rằng $$LN = \sqrt{MN^2 + LM^2} = \sqrt{4 + 21} = 5.$$Sau đó $\sin L = \boxed{\frac{2} {5}}$.

